module.exports = "\r\n\r\n<div class=\"main_bg\">\r\n    <div class=\"privacywrapper\">\r\n  \r\n      <div class=\"logo_wrapper\">\r\n        <img src=\"assets/images/artistheaderlogo.png\">\r\n      </div>\r\n  \r\n      <div class=\"page_header\">\r\n        <h1>ArtistXP Affiliate Program Agreement</h1>\r\n      </div>\r\n  \r\n      <div class=\"page_content\">\r\n  \r\n          <p>By participating or attempting to participate in the ArtistXP, Inc. (“<strong>ArtistXP</strong>”) marketing affiliate program (the “<strong>Affiliate Program</strong>”), you agree to this ArtistXP Affiliate Program Agreement (this “<strong>Agreement</strong>”). You acknowledge and agree that you have read, understand and agree to be bound by all of the terms and conditions of this Agreement, as well as all other applicable rules or policies provided by ArtistXP from time to time, including without limitation, the ArtistXP Terms of Use and Privacy Policy (collectively, the “<strong>ArtistXP Policies</strong>”), which are incorporated herein by reference and may be changed from time to time in ArtistXP’s sole and absolute discretion, and understand that you are entering into a legally binding agreement with ArtistXP.\r\n            <br><br>\r\n              ArtistXP reserves the right to change and/or modify this Agreement  at any time in its sole discretion by posting a change notice or revised Agreement on www.artistxp.com (or any corresponding web page thereof) (the “ e”) or via your Affiliate Account (as defined below) or by sending notice of such modification to you by email to the primary email address then-currently associated with your Affiliate Account. The effective date of such change will be the date specified in such notice. YOUR CONTINUED PARTICIPATION IN THE AFFILIATE PROGRAM FOLLOWING THE EFFECTIVE DATE OF SUCH CHANGE WILL CONSTITUTE YOUR ACCEPTANCE OF THE MODIFICATIONS. IF ANY MODIFICATION IS UNACCEPTABLE TO YOU, YOUR ONLY RECOURSE IS TO TERMINATE THIS AGREEMENT IN ACCORDANCE WITH SECTION 6.\r\n        </p>\r\n        <h1>The Affiliate Program</h1>\r\n        <p>The Affiliate Program provides the opportunity to earn commissions on qualifying purchases of ArtistXP and AudioDeadline merchandise, BlockChained Media, ArtistXP Games, Contest Enrollment Fees, and Tickets to view an Audio Deadline live-streamed event (an “Event”) online on the ArtistXP Site as follows, subject to and in accordance with the terms and conditions of this Agreement:</p>\r\n        <ol class=\"loweralphabracket\">\r\n            <li>ArtistXP will provide unique tracking link(s) (which may include shared media links) to the ArtistXP Site (“<strong>Links</strong>”), which you may place on websites or social media user-generated content (collectively, “<strong>Sites</strong>”) that you own and/or control.</li>\r\n  \r\n            <li>For each person who arrives on the ArtistXP Site by clicking on a Link on one of your Sites (each, a “<strong>Direct Referred Customer</strong>”) and completes a Qualifying Purchase, you will earn a commission of 10% of the Net Receipts attributable thereto. A “<strong>Qualifying Purchase</strong>” occurs when a person arrives on the ArtistXP Site by clicking on a Link on your Site or the Site of a Direct Referred Affiliate or Indirect Referred Affiliate (as applicable), and, in the same transaction, completes a qualifying purchase. “<strong>Net Receipts</strong>” means the monies actually received by ArtistXP from a Qualifying Purchase, less any chargebacks (and associated fees), credits, refunds, credit card processing fees and taxes (e.g., sales tax, VAT, etc.).</li>\r\n  \r\n            <li>If a Direct Referred Customer participates in the Affiliate Program (any such Direct Referred Customer, a “<strong>Direct Referred Affiliate</strong>”), then, for each person who arrives on the ArtistXP Site by clicking on a Link on the Direct Referred Affiliate’s Site (each, an “<strong>Indirect Referred Customer</strong>”) and completes a Qualifying Purchase, you will earn a commission of 5% of the Net Receipts attributable thereto.\r\n          </li>\r\n        </ol>\r\n        <h1>Enrollment Process</h1>\r\n          <p>You may apply to participate in the Affiliate Program via https://artistxp.com/. ArtistXP may reject your application for any reason, in ArtistXP’s sole discretion. If your application is accepted, ArtistXP will notify you of the same via email to the email address provided in your application and provide you with a link that will enable you to create an affiliate account on the ArtistXP Site (your “<strong>Affiliate Account</strong>”). In order to participate in the Affiliate Program and receive Commissions as described in this Agreement, you must register for an Affiliate Account.</p>\r\n        <h1>Payment</h1>\r\n        <p>Commissions are payable on a monthly basis, within seven days following the end of the applicable month, provided that Commissions will not be paid out until (a) the aggregate amount of the Commissions exceeds $100 and (b) you make a request for such payment through your Affiliate Account. Payment will be made to you in accordance with the payment details you enter in your Affiliate Account. ArtistXP will make reporting regarding your Commissions available to you via your Affiliate Account. You will be solely responsible for all taxes, costs and expenses related to your participation in the Affiliate Program. If you choose to be paid via ACH (if presented as a payment option in your Affiliate Account), a transaction fee of $1.00 per payment transaction will be deducted from the payment amount.</p>\r\n        <h1>Identifying Yourself as an Affiliate</h1>\r\n        <p>You must clearly state the following on your Site: “As an ArtistXP Affiliate I earn from qualifying purchases.” Except for this disclosure, you will not make any public communication with respect to this Agreement or your participation in the Affiliate Program without ArtistXP’s advance written permission. You will not misrepresent or embellish your relationship with ArtistXP (including by expressing or implying that ArtistXP supports, sponsors, or endorses you), or express or imply any affiliation between ArtistXP and you or any other person or entity except as expressly permitted by this Agreement. You must not make inaccurate, overbroad, deceptive or otherwise misleading claims about any Event, the ArtistXP Site, or any of ArtistXP’s products or services. You are solely responsible for your Site, including the operation thereof and all materials that appear on or within it.</p>\r\n        <h1>Promotional Limitations</h1>\r\n        <p>You will not engage in any promotional, marketing, or other advertising activities on behalf of ArtistXP or its affiliates, or in connection with the ArtistXP Site or Affiliate Program, that are not expressly permitted under the Agreement. You will not engage in any promotional, marketing, or other advertising activities in any offline manner, including by using any of ArtistXP or its affiliates’ trademarks or logos, or any Material (as defined below) in connection with email, offline promotion or in any offline manner.</p>\r\n        <h1>Term and Termination</h1>\r\n        <p>The term of this Agreement will begin upon your registration for the Affiliate Program. Either you or ArtistXP may terminate this Agreement at any time, with or without cause, by giving the other party written notice of termination provided that the effective date of such termination will be seven days from the date notice is provided. You can provide termination notice by logging into your Affiliate Account and selecting the option to close your account. In addition, ArtistXP may terminate this Agreement immediately at any time upon written notice to you in the event that: (a) you are in material breach of this Agreement or you are in non-material breach of this Agreement but you do not remedy it within seven days from  receipt of ArtistXP’s notice of such breach; (b) ArtistXP believes that it may face potential claims or liability in connection with your participation in the Affiliate Program; (c) ArtistXP believes that its brand or reputation may be tarnished by you or in connection with your participation in the Affiliate Program; (d) ArtistXP believes that it is or may become subject to tax collection requirements in connection with this Agreement or the activities performed by either party under this Agreement; (e) ArtistXP has previously terminated this Agreement with respect to you or other persons that ArtistXP determines are affiliated with you or acting in concert with you for any reason; or (f) ArtistXP has terminated the Affiliate Program as it generally makes it available to participants.\r\n          <br><br>\r\n            Upon any termination of this Agreement, all rights and obligations of the parties will be terminated, including any and all licenses granted in connection with this Agreement, except that the rights and obligations of the parties under Sections 7 through 12 of this Agreement and as specified in the Program Policies, together with any then-payable but unpaid payment obligations under this Agreement, will survive the termination of this Agreement. No termination of this Agreement will relieve either party for any liability for any breach of, or liability accruing under, this Agreement prior to termination.</p>\r\n        <h1>Intellectual Property</h1>\r\n        <p>ArtistXP owns all right, title and interest in and to the Events, ArtistXP Site and ArtistXP’s products and services and related developments, enhancements and revisions, intellectual property rights and/or proprietary rights therein and related thereto.  In order to facilitate your advertisement of the Events, ArtistXP may make available to you data, images, text, link formats, widgets, links, marketing content, and other linking tools, application program interfaces, and other information in connection with the Affiliate Program (collectively with the Links, “Materials\").  “Materials” specifically excludes any data, images, text, or other information or content relating to product offerings on any site other than the ArtistXP Site.\r\n  <br><br>\r\n            During the term of this Agreement, ArtistXP hereby grants to you a non-transferable, non-exclusive, limited license to use ArtistXP’s name and those logos and/or trademarks provided to you by ArtistXP (collectively, the “Trademarks”) and the Materials in accordance with this Agreement solely in relation to the performance of the services described herein.  Your use of such Trademarks and Materials shall be in accordance with ArtistXP’s policies and procedures established from time to time. You shall not do and/or cause to be done any act and/or anything contesting and/or in any way impairing and/or reducing ArtistXP’s right, title and interest in the Trademarks and/or Materials.  ArtistXP has the right to discontinue and/or alter the form, shape and/or artwork of the Trademarks and/or content of the Materials. You acknowledge that your use of the Trademarks and/or Materials shall not create any right, title and interest, in or to the Trademarks and/or Materials and all such uses inure to the benefit of ArtistXP. ArtistXP reserves the right at any time to review your use of the Trademarks and/or Materials to determine if such use is in compliance with this Agreement.  In the event ArtistXP desires to include your information on its affiliate program website at any time during the term of this Agreement, you hereby grant to ArtistXP a non-transferable, non-exclusive, limited license to use the logos and/or trademarks provided by you on such website.</p>\r\n        <h1>Confidentiality</h1>\r\n          <p>You will keep all proprietary information related to the business of ArtistXP and any of its affiliates, clients and other third parties to which you have access, whether in oral, written, graphic and/or machine-readable form, in the course of or in connection with this Agreement (collectively, the “<strong>Confidential Information</strong>”) confidential and will only use such Confidential Information to perform your obligations under this Agreement. You may disclose the Confidential Information only to those who have a need to know such Confidential Information solely in connection with this Agreement; provided that you assume full responsibility for any failure to comply with this Agreement. You acknowledge that a breach of the obligations related to Confidential Information may result in irreparable and continuing damage to ArtistXP for which monetary damages may not be sufficient, and you agree that ArtistXP will be entitled to seek, in addition to its other rights and remedies hereunder or at law, injunctive or all other equitable relief, and such further relief as may be proper from a court of competent jurisdiction.</p>\r\n        <h1>Representations and Warranties</h1>\r\n        <p>You represent, warrant, and covenant that (a) you will participate in the Affiliate Program and create, maintain, and operate your Site in accordance with this Agreement, (b) your participation in the Affiliate Program and your creation, maintenance, and operation of your Site will comply with all applicable laws, ordinances, rules, regulations, orders, licenses, permits, guidelines, codes of practice, industry standards, self-regulatory rules, judgments, decisions, or other requirements of any governmental authority that has jurisdiction over you (including all such rules governing communications, data protection, advertising, and marketing), including, without limitation, the Federal Trade Commission Endorsement Guides, and all laws relating to privacy and data security, (c) you are at least 18 years old (or the applicable age of majority in your jurisdiction), (d) you have independently evaluated the desirability of participating in the Affiliate Program and are not relying on any representation, guarantee, or statement other than as expressly set forth in this Agreement, (e) will comply with all U.S. or other export and re-export restrictions that may apply to goods, software, technology and services, and (f) the information you provide in connection with the Affiliate Program is accurate and complete at all times.\r\n          <br><br>\r\n            ArtistXP does not make any representation, warranty, or covenant regarding the amount of traffic or fees you can expect at any time in connection with the Affiliate Program.\r\n            <br><br>\r\n            EXCEPT AS EXPRESSLY SET FORTH IN THIS AGREEMENT, NEITHER PARTY MAKES ANY OTHER WARRANTY, EXPRESS OR IMPLIED, INCLUDING WITHOUT LIMITATION ANY IMPLIED WARRANTIES OF MERCHANTABILITY AND/OR FITNESS FOR A PARTICULAR PURPOSE. THE AFFILIATE PROGRAM, THE ARTISTXP SITE, ANY PRODUCTS AND SERVICES OFFERED THEREON, ANY LINKS, LINK FORMATS, CONTENT, PRODUCT ADVERTISING CONTENT, ARTISTXP AND ITS AFFILIATES’ DOMAIN NAMES, TRADEMARKS AND LOGOS, AND ALL TECHNOLOGY, SOFTWARE, FUNCTIONS, MATERIALS, DATA, IMAGES, TEXT, AND OTHER INTELLECTUAL PROPERTY RIGHTS, INFORMATION AND CONTENT PROVIDED OR USED BY OR ON BEHALF OF ARTISTXP OR ITS AFFILIATES OR LICENSORS IN CONNECTION WITH THE AFFILIATE PROGRAM (COLLECTIVELY THE “SERVICE OFFERINGS”) ARE PROVIDED “AS IS” AND “AS AVAILABLE”. ARTISTXP MAY DISCONTINUE ANY SERVICE OFFERING, OR MAY CHANGE THE NATURE, FEATURES, FUNCTIONS, SCOPE, OR OPERATION OF ANY SERVICE OFFERING, AT ANY TIME AND FROM TIME TO TIME. NEITHER ARTISTXP NOR ANY OF ITS AFFILIATES OR LICENSORS WARRANT THAT THE SERVICE OFFERINGS WILL CONTINUE TO BE PROVIDED, WILL FUNCTION AS DESCRIBED, CONSISTENTLY OR IN ANY PARTICULAR MANNER, OR WILL BE UNINTERRUPTED, ACCURATE, ERROR FREE, OR FREE OF HARMFUL COMPONENTS. NEITHER ARTISTXP NOR ANY OF ITS AFFILIATES OR LICENSORS WILL BE RESPONSIBLE FOR (A) ANY ERRORS, INACCURACIES, VIRUSES, MALICIOUS SOFTWARE, OR SERVICE INTERRUPTIONS, INCLUDING POWER OUTAGES OR SYSTEM FAILURES OR (B) ANY UNAUTHORIZED ACCESS TO OR ALTERATION OF, OR DELETION, DESTRUCTION, DAMAGE, OR LOSS OF, YOUR SITE OR ANY DATA, IMAGES, TEXT, OR OTHER INFORMATION OR CONTENT. NOTHING IN THIS PARAGRAPH WILL OPERATE TO EXCLUDE OR LIMIT WARRANTIES, LIABILITIES, OR REPRESENTATIONS THAT CANNOT BE EXCLUDED OR LIMITED UNDER APPLICABLE LAW.</p>\r\n        <h1> Indemnification</h1>\r\n        <p>You will indemnify, defend and hold harmless ArtistXP, its officers, associates, employees, contractors and agents from and against any and all claims, damages, liabilities, losses, costs, demands and expenses (including reasonable attorneys’ fees and costs of litigation) arising out of or relating to (a) your Site or any materials that appear on your Site, including the combination of your Site or those materials with other applications, content, or processes, (b) your or your employees’ or contractors’ negligent act and/or omission or willful misconduct; (c) any misrepresentation by you related to ArtistXP’s products and services(s), (d) your breach of this Agreement (including any of the ArtistXP Policies) or (e) violation of any applicable law, rule, regulation, or order of any governmental (including any regulatory or quasi-regulatory) agency or contract.</p>\r\n        <h1>Dispute Resolution</h1>\r\n        <p>Any dispute relating in any way to the Affiliate Program and/or this Agreement (including any actual or alleged breach hereof), whether arising in contract, statute, tort, fraud, misrepresentation, discrimination, common law or any other legal theory, including, but not limited to disputes relating to the making, performance or interpretation of this Agreement, shall be subject to binding arbitration, to be held in New York, New York, in accordance with the Federal Arbitration Act and with the Commercial Rules then in effect of the American Arbitration Association (“AAA”) available at www.adr.org.  In any arbitration proceeding conducted pursuant to this Section, the parties shall have the right to discovery, to call witnesses, and to cross-examine the other party’s witnesses.  The arbitrator shall render a final decision in writing, setting forth the reasons for the arbitration award.  Both parties are bound by this agreement to arbitrate.  THE PARTIES WAIVE THEIR RIGHT TO HAVE ANY SUCH DISPUTE, CLAIM OR CONTROVERSY DECIDED BY A JUDGE OR JURY IN A COURT.  THE PARTIES ALSO AGREE THAT EACH MAY BRING CLAIMS AGAINST THE OTHER ONLY IN THEIR INDIVIDUAL CAPACITIES, AND NOT AS A PLAINTIFF OR CLASS MEMBER IN ANY PURPORTED CLASS, REPRESENTATIVE OR COLLECTIVE PROCEEDING.  If either party initiates or joins in a lawsuit or arbitration against the other party in violation of this waiver and a court or arbitrator deems the waiver to be unenforceable for any reason, then to the extent the waiver is invalidated, claims subject to the invalidated waiver shall no longer be subject to arbitration, but shall instead proceed in court, with all remaining claims remaining subject to arbitration.  To the extent claims subject to the invalidated waiver depend upon resolution of the same or similar facts as the claims to be arbitrated, the parties agree that such claims shall be stayed in court pending resolution of the arbitration.  This agreement to arbitrate claims does not include disputes, controversies or differences which may not by law be arbitrated.  Notwithstanding anything to the contrary in this Agreement, ArtistXP may seek injunctive or other relief in any state, federal, or national court of competent jurisdiction for any actual or alleged infringement of ArtistXP’s or any other person or entity’s intellectual property or proprietary rights. You further acknowledge and agree that ArtistXP’s rights in the Materials are of a special, unique, extraordinary character, giving them peculiar value, the loss of which cannot be readily estimated or adequately compensated for in monetary damages.</p>\r\n        <h1>Miscellaneous</h1>\r\n        <p>Nothing contained in this Agreement shall create or imply any agency relationship between the parties, nor shall this Agreement be deemed to constitute a joint venture or partnership between the parties. It is further understood and agreed that your relationship with ArtistXP is and shall continue to be that of an independent contractor and you shall not be entitled to receive employee benefits from ArtistXP and you are responsible for the payment of all taxes and withholdings specified by law, which may be due in regard to payments made by ArtistXP.  No waiver of any of the terms of this Agreement by either party will be valid unless agree to in writing and designated as such.  Any forbearance or delay on the part of either party in enforcing any of its rights under this Agreement will not be construed as a waiver of such right to enforce same for such occurrence or any other occurrence.  If any one or more of the provisions of this Agreement are for any reason held to be invalid, illegal or unenforceable by a court of competent jurisdiction, the remaining provisions of this Agreement will be unimpaired and will remain in full force and effect.  The headings and titles of the paragraphs of this Agreement are for convenience only and are not intended to define, limit or construe the contents of the provisions contained herein. You may not assign, as a result of a change of control or by operation of law or otherwise, your rights and/or obligations under this Agreement without the prior written consent of ArtistXP.  This Agreement will be binding upon the parties and their respective legal successors and permitted assigns.  This Agreement will be governed by, and construed in accordance with, the internal laws of the State of New York, without regard to its choice of laws principles. Any action related to or arising from this Agreement that is an exception to the arbitration process described herein shall take place exclusively in the courts situated in New York, New York and the parties hereby submit to the venue of the courts situated therein.  This Agreement constitutes the complete agreement and understanding between the parties with respect to the subject matter hereof, and supersedes all prior agreements and understandings between the parties.  This Agreement may be delivered and executed electronically using electronic signature or by other electronic communication used by the parties.</p>\r\n        <h1>Artistxp CORP</h1>\r\n          <div class=\"assignwrapper\">\r\n              <h5 class=\"asbetos\">Beto Paredes</h5>\r\n          </div>\r\n        <p>By: Beto Paredes<br>\r\n          Its: Chief Executive Officer</p>\r\n        <h1>AFFILIATE</h1>\r\n  \r\n        <!--<div class=\"container-fluid newpage_wrapper\">\r\n    <div class=\"pdf_wrapper page1pdf\">\r\n      <h2>This agreement date of execution is : {{currentdate | date:'MM/dd/yyyy'}}</h2>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">This Affiliate Agreement (\"Agreement\") contains the complete terms and conditions between Audio Deadline Corp (\"Company\") and <span style=\"text-decoration: underline;font-size: larger\">{{fullname}}</span>, who wishes to participate in the Audio Deadline Affiliate Program (the \"Affiliate Program\") as an affiliate of Audio Deadline Corp (an \"Affiliate\"). Both Company and Affiliate may collectively be referred to as (\"Parties\").</div>\r\n      <h3> DEFINITIONS </h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">\"Affiliate\" - The business, individual, or entity applying to or participating in the Affiliate Program, or that displays Audio Deadline’s products and Services and/or promotions on its website, or other means, using an affiliate tracking code in exchange for receiving a commission from Company for sales directly resulting from such display.<br/><br/>\"Company's Products and Services\" – digital online community portal focused on live broadcasting services to fans, clothing, and other future opportunities presented by the company.</div>\r\n  \r\n      <h3>AFFILIATE RELATIONSHIP</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">The Parties acknowledge that Affiliate will perform their obligations hereunder as an independent contractor or Affiliate and shall not be an employee of Company.  It is also expressly understood that Affiliate's employees and agents, if any, are not Company's employees or agents, and have no authority to bind Company by contract or otherwise.<br/><br/>Affiliate agrees they are solely responsible for understanding their rights and obligations as an Affiliate in their geographic area.<br/><br/>Company shall not be liable for taxes, worker's compensation, unemployment insurance, employers' liability, employer's FICA, social security, withholding tax, or other taxes or withholding for or on behalf of Affiliate or any other person consulted or employed by the Affiliate in performing Services under this Agreement. All such costs shall be Affiliate's responsibility.</div>\r\n      <h3> COMPENSATION</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">Affiliate will receive 10% commissions from any products or services sold to their fans/reach/clients on the Company's platform.<br/><br/>Affiliate will get 5% commissions from any products or services sold by any individual that signs up officially through the affiliate's links if they decided to also join as an affiliate of the company.<br/><br/>Commissions, as described above, will commence for the lifetime purchase of the fan/reach/client.</div>\r\n      <h3> COMMISSION PAYMENTS</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">All commissions accumulated over the amount of $150 are paid out monthly. Commission amounts must be at least $150 USD at the end of the month to be paid out that following month.<br/><br/>Affiliate shall provide Company with a w9 form before commissions are paid to affiliate. Affiliate is responsible to providing Company with up-to-date w9 form. Company may provide this digitally or affiliate may be responsible for scanning and sending before first payment is made.</div>\r\n      <h3>REPORTS OF QUALIFIED PURCHASES</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">Starting before the month of November 2018, you may log into your affiliate console to review your click through and potential Qualified Purchases statistics daily. The potential Qualified Purchases shown in this report have not been reviewed to confirm they meet all criteria for Qualified Purchases. As such, Commission Fees may not be issued for all Referred Customers that appear in the affiliate console.</div>\r\n      <h3>FTC ENDORSEMENT COMPLIANCE</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">It is the intent of Company to treat all of our customers fairly. Accordingly, we require all Company Affiliates to comply with applicable laws, regulations and guidelines concerning advertising and marketing, including without limitation, the Federal Trade Commission (FTC) Endorsement Guides, which require that material connections between advertisers and endorsers be disclosed. This means that all Affiliate Sites (e.g. directories, review/rating websites, blogs, and other websites) and any email or collateral that provide an endorsement or assessment of Audio Deadline's Products and Services must prominently disclose the fact that you receive compensation.<br/><br/>Company reserves the right to withhold Commission Fees and cancel the affiliate relationship with you should we determine, at our sole discretion, that you are not in compliance with the previously mentioned guide or other FTC regulations or guides that we deem relevant.</div>\r\n      <h3>NON­DISCLOSURE</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">The Affiliate agrees to not disclose any of the details in this agreement either implicitly, explicitly, or indirectly to any competing entity, employee of Company or subsidiary, contractor of Company or subsidiary, and client of Company or subsidiary without permission explicitly given by Company. The Affiliate agrees not to disclose details of compensation with any entity without the explicit permission of Company.<br/><br/>Affiliate agrees not to disclose or otherwise reveal to any third party the identities, addresses, telephone numbers, facsimile numbers, email address, telex numbers, bank codes, account number, financial reference, or any other entities introduces by Company to the Affiliate without the specific written permission of Company.<br/><br/>Confidential Information.  The Affiliate agrees that they shall not, directly or indirectly, disclose, disseminate, use for personal benefit, lecture or write articles with respect to, or otherwise publish \"confidential information\".  For purposes of this Agreement, the term \"confidential information\" means information and know­how disclosed to or known by the Affiliate which relates to the Company or any business idea under development or research by the Company or that constitutes a corporate opportunity of the Company and which information is not generally known in the relevant trade or industry, including without limitation, any document, information, website or other data requiring pass code or password access, trade secrets, proprietary data, customer lists, contractual arrangements, and product and service development. \"Confidential information\" shall also include any other document or information (whether of the Company or of any supplier or customer of the Company or of any other person with which the Company has an agreement with respect to the confidentiality of information) labeled \"confidential\", \"proprietary\", or words of similar import.  Upon Termination of the Term hereof, the Affiliate shall return to or leave with the Company, without making or retaining copies thereof, all documents, records, notebooks and similar repositories containing \"confidential information\".</div>\r\n      <h3 style=\"line-height: 24px;\">INDEMNIFICATION</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">Affiliate shall not be liable for any claim or demand made against Company by any third party.  Company shall indemnify Affiliate against all claims, liabilities and costs, including reasonable attorney fees, of defending any third-party claim or suit arising out of the use of the software provided under this agreement. However, the Affiliate hereby agrees to indemnify and hold Company harmless from all liability, damage, loss, cost, expense or other charge resulting directly or indirectly from any act or omission of the Affiliate.  It is understood that Affiliate is to use and only use the regulated media for promotion of any sign ups or sales and the Company is not liable for what the affiliate may present outside of these materials. These materials are all available of the website and through the affiliate back office.</div>\r\n      <h3>STANDARDS AND ETHICS</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">Affiliate will adhere to truth and integrity and will not engage in any deceptive or misleading sales practices.<br/><br/>Affiliate will not in any way demean or speak negatively of Company, Company's Clients, Company's Potential Clients, Any member of Company, Company's Competition, or Affiliate's Competition.<br/><br/>Affiliate will maintain the confidentially of information provided by any prospect or client of Company and will not reveal any such information without the proper consent or exemption of Company.</div>\r\n      <h3>GOVERNING LAW AND FORUM</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">This Agreement shall be governed, construed and enforced exclusively in accordance with the laws of the State of Idaho and the laws of the United States of America, without regard to choice of laws or conflict of law provisions thereof that would result in the application of the laws of a different jurisdiction. Any arbitration or litigation between the Parties shall be conducted exclusively in Idaho, and the Parties hereby submit to such exclusive jurisdiction and venue and agree that venue shall be proper in Idaho. Each Party hereby irrevocably waives, to the fullest extent permitted by law, any objection that it may have, whether now or in the future, to the laying of venue in, or to the jurisdiction of, any and each of such courts for the purpose of any such suit, action, proceeding or judgment and further waives any claim that any such suit, action proceeding or judgment has been brought in an inconvenient forum, and each Party hereby submits to such jurisdiction.</div>\r\n      <h3>X. NOTICES</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">Any notice required or permitted to be given under this Agreement shall be sufficient if it is in writing and if it is sent by registered mail or certified mail, return receipt requested, to the Employee at his or her residence affixed above, or to the Employer’s principal place of business as affixed above.</div>\r\n      <h3>ENTIRE AGREEMENT</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">This agreement contains the entire understanding of the Parties and supersedes any and all previous verbal and written agreement or understandings. There are no other agreements, representations or warranties not set forth in this agreement. This agreement will bind, and inure to the benefit of, the Parties and their respective successor and assigns. Any modification, amendment, or waiver of any provision of this agreement may be made only in writing and signed by both Parties. The failure by any party to exercise any rights granted herein upon the occurrence of any event set forth in this agreement shall not constitute a waiver of any such rights upon the occurrence of any such event. In the event any provision of this agreement is held to be in violation of any law, statue, regulation, ordinance, or court order, this agreement shall be deemed modified accordingly and to the extent necessary to comply therewith and shall otherwise continue full force and effect.</div>\r\n      <h3>AGREEMENT EXECUTION</h3>\r\n      <div class=\"pdf_page1_block1\" style=\"text-align: left;\">This digital signature constitutes the full legal agreement between company and affiliate. This agreement may be executed in several counterparts, each of which shall constitute one and the same instrument.  Section or paragraph headings in the agreement are for convenience of reference only.<br/>In witness whereof, the Parties hereto have caused this Agreement to be duly executed and entered into as of the date first above written.</div>\r\n      <div class=\"pdf_page1_signblock\">\r\n        <h3>Audio Deadline Corp</h3>\r\n        <h4>By: Beto Paredes</h4>\r\n        <h4>Its: Chief Executive Officer</h4>\r\n      </div>\r\n      <div class=\"clearfix\"></div>\r\n      <div class=\"pdf_page1_signblock\">\r\n        <h3>Affiliate</h3>\r\n        <div class=\"new_signup_condiv\">\r\n          <div class=\"new_signup_inpitdiv\">\r\n            <div class=\"new_signupdiv\">\r\n              <input type=\"button\"  class=\"signherebtn\" value=\"Sign Here\" (click)=\"openSignModal(template)\">\r\n            </div>\r\n          </div>\r\n          <div class=\"clearfix\"></div>\r\n        </div>\r\n        <h5>By: <span>{{signval}} </span></h5>\r\n        <span *ngIf=\"error\" class=\"signerror\">Please sign here!</span>\r\n      </div>\r\n      <div class=\"clearfix\"></div>\r\n    </div>\r\n    <input type=\"button\" (click)=\"contractagrrement()\" value=\"Submit \" class=\"ep_contractbtn\">\r\n  </div>-->\r\n          <div class=\"assignwrapper\">\r\n                <div class=\"clearfix\"></div>\r\n                <div class=\"pdf_page1_signblock\">\r\n                  <div class=\"new_signup_condiv\">\r\n                    <div class=\"new_signup_inpitdiv\">\r\n                      <div class=\"new_signupdiv\">\r\n                        <input type=\"button\"  class=\"signherebtn\" value=\"Sign Here\" (click)=\"openSignModal()\">\r\n                      </div>\r\n                    </div>\r\n                    <div class=\"clearfix\"></div>\r\n                  </div>\r\n                  <h5>By: <span>{{signval}} </span></h5>\r\n                  <span *ngIf=\"error\" class=\"signerror\">Please sign here!</span>\r\n                </div>\r\n                <div class=\"clearfix\"></div>\r\n              <input type=\"button\" (click)=\"contractagrrement()\" value=\"Submit \" class=\"ep_contractbtn\">\r\n          </div>\r\n  \r\n\r\n    </div>\r\n    </div>\r\n  </div>"

